import React from 'react'

import { useLocation } from 'react-router-dom'

function Media(props) {
  const { loading = false } = props;

  return (
    <div style={{display:"flex",justifyContent:"center",}}>

   
    <Card sx={{ maxWidth: 545, m: 5,height:545}}>
      <h3 style={{color:"red",fontStyle:"oblique",textAlign:"center"}}>Get What You Eye</h3>
      <CardHeader 
        avatar={
          loading ? (
            <Skeleton animation="wave" variant="circular" width={40} height={40} />
          ) : (
            <Avatar 
              alt="food image" style={{width:"80%",height:"50px"}}
              src="https://media.istockphoto.com/id/1092662886/photo/assorted-indian-spices-in-circle-with-space-for-text.jpg?s=612x612&w=0&k=20&c=XZvigdzSep73cWSzMjYI8uJ1JBjaon-WRqj8fgAU20A="
            />
          )
        }
        // action={
        //   loading ? null : (
        //     <IconButton aria-label="settings">
        //       <MoreVertIcon />
        //     </IconButton>
        //   )
        // }
        title={
          loading ? (
            <Skeleton
              animation="wave"
              height={10}
              width="80%"
              style={{ marginBottom: 6 }}
            />
          ) : (
            'ITEM(S)  ADDED'
          )
        }
        // subheader={
        //   loading ? (
        //     <Skeleton animation="wave" height={10} width="40%" />
        //   ) : (
        //     '5 hours ago'
        //   )
        // }
      />
      {loading ? (
        <Skeleton sx={{ height: 190 }} animation="wave" variant="rectangular" />
      ) : (
        <CardMedia
          component="img"
          height="140"
          image="https://pi.tedcdn.com/r/talkstar-photos.s3.amazonaws.com/uploads/72bda89f-9bbf-4685-910a-2f151c4f3a8a/NicolaSturgeon_2019T-embed.jpg?w=512"
          alt="Nicola Sturgeon on a TED talk stage"
        />
      )}

      <CardContent>
        {loading ? (
          <React.Fragment>
            <Skeleton animation="wave" height={10} style={{ marginBottom: 6 }} />
            <Skeleton animation="wave" height={10} width="80%" />
          </React.Fragment>
        ) : (
          <Typography variant="body2" color="text.secondary" component="p">
            {
              "Why First Minister of Scotland Nicola Sturgeon thinks GDP is the wrong measure of a country's success:"
            }
          </Typography>
        )}
      </CardContent>
    </Card>
    </div>
  );
}

Media.propTypes = {
  loading: PropTypes.bool,
};


function Cart() {
  const location=useLocation();   
  const val1=location.state.val;
  const name1=location.state.name
  console.log(val1,name1)

  const handlelogout=async()=>{
    const result=await(await fetch("http://localhost:9000/rest/logout",{
      method:"POST",
      credentials:"include"
    })).json()
    
    console.log(result);
    // .then(res=>console.log(res.json()))
    // .then(a=>console.log(a))
    localStorage.setItem("token","")
     }
  return (
   <>
   <div className="head container">

   
<img src='https://mir-s3-cdn-cf.behance.net/projects/404/2971a3169377049.Y3JvcCwxMDgwLDg0NCwwLDExNw.png' style={{width:"190px",height:"160px",marginTop:"-40px"}} />

 {/* {localStorage.getItem("token")&&<h4>Welcome {((JSON.parse(localStorage.getItem("token"))).email)} {console.log((JSON.parse(localStorage.getItem("token"))).email)} </h4>
} */}

<ul className="list"> 
{/* <li><a href="/cart"><i class="fa fa-shopping-cart" aria-hidden="true"></i></a></li> */}
   <li><a href="/" onClick={handlelogout} >Logout</a></li>
   
   </ul>
</div>




<div>
      {/* <Media loading /> */}
      <Media />
    </div>

   </>
  )
}

export default Cart
